import React from 'react';
import './css/Home.css';
import { useNavigate } from 'react-router-dom'; // ✅ Import navigation

const Home = () => {
  const navigate = useNavigate(); // ✅ Hook for navigation

  const handleBookClick = () => {
    navigate('/appointmentform'); // ✅ Navigate to form page
  };

  return (
    <section id="home" className="home-section">
      <div className="hero">
        <h2>Welcome to Krishna Clinic</h2>
        <p>General and Family Healthcare near Bhakti Circle, Ahmedabad</p>
        <button onClick={handleBookClick} className="btn">Book Appointment</button>
      </div>
    </section>
  );
};

export default Home;
